import { Route, Routes } from "react-router-dom";
import { Box } from "@mui/material";
import "./App.css";
import Signup from "./components/Signup";

function App() {
  return (
    <Box>
      <Box>
        <Routes>
          <Route exact path="/" element={<Signup />} />
        </Routes>
      </Box>
    </Box>
  );
}

export default App;
